const initialState = {
  destination: '',
  result: ''
}

const sky = (state = initialState, action) => {
  let nextState = Object.assign({}, state)
  switch (action.type) {
    case 'GET_IP':
      return Object.assign({}, nextState, action.payload)
    case 'mainSearch':
      nextState.destination = action.payload
      return nextState
    case 'GET_CHEAP':
      console.log('GET!!', action.payload)
      nextState.result = action.payload
      return nextState
    default:
      return state
  }
}

export default sky
